const Home = () => {
  const styles = {
    app: {
      backgroundColor: '#f8f8f8',
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
    },
  };

  return (
    <div className="app" style={styles.app}>
      <Header />
      <Menu />
      <Footers />
    </div>
  );
};
